drop database if exists scraper_videojuegos;
create database scraper_videojuegos;
use scraper_videojuegos;
create table juegos(
	id int not null auto_increment primary key,
    nombre varchar(255),
    fecha_lanzamiento date,
    precio float
);
create table generos(
	id int not null auto_increment primary key,
    nombre varchar(255)
);
create table desarrolladores(
	id int not null auto_increment primary key,
    nombre varchar(255)
);
create table publicadores(
	id int not null auto_increment primary key,
    nombre varchar(255)
);
create table consolas(
	id int not null auto_increment primary key,
    nombre varchar(255)
);
create table clasificaciones(
	id int not null auto_increment primary key,
    nombre varchar(255)
);
create table ratings(
	id int not null,
    metarating float,
    userrating float,
    foreign key(id) references juegos(id)
);
create table juegos_generos(
	juego_id int,
    genero_id int not null,
    foreign key(juego_id) references juegos(id),
    foreign key(genero_id) references generos(id)
);
create table juegos_desarrolladores(
	juego_id int not null,
    desarrollador_id int not null,
    foreign key(juego_id) references juegos(id),
    foreign key(desarrollador_id) references desarrolladores(id)
);
create table juegos_publicadores(
	juego_id int not null,
    publicador_id int not null,
    foreign key(juego_id) references juegos(id),
    foreign key(publicador_id) references publicadores(id)
);
create table juegos_consolas(
	juego_id int not null,
    consola_id int not null,
    foreign key(juego_id) references juegos(id),
    foreign key(consola_id) references consolas(id)
);
create table juegos_clasificaciones(
	juego_id int not null,
    clasificacion_id int not null,
    foreign key(juego_id) references juegos(id),
    foreign key(clasificacion_id) references clasificaciones(id)
);
create table juegos_ratings(
	juego_id int not null,
    rating_id int not null,
    foreign key(juego_id) references juegos(id),
    foreign key(rating_id) references ratings(id)
);
delimiter //

CREATE PROCEDURE fill_from_tuple(
    IN gamename_var VARCHAR(255), 
    IN platform_var VARCHAR(255), 
    IN releasedate_var DATE, 
    IN metarating_var FLOAT, 
    IN userrating_var FLOAT, 
    IN developer_var VARCHAR(255), 
    IN publisher_var VARCHAR(255), 
    IN genre_var VARCHAR(255), 
    IN esrb_var VARCHAR(255), 
    IN price_var FLOAT
)
BEGIN
    -- juegos 
    INSERT INTO juegos(nombre, fecha_lanzamiento, precio)
    VALUES (gamename_var,releasedate_var,price_var);
    SELECT MAX(id) INTO @juegos_last_id FROM juegos;

    -- Developer
    SELECT COUNT(*) INTO @developer_validation FROM desarrolladores WHERE nombre = developer_var;
    IF @developer_validation = 0 THEN
        INSERT INTO desarrolladores(nombre) VALUES(developer_var);
        SELECT MAX(id) INTO @desarrolladores_last_id FROM desarrolladores;
        INSERT INTO juegos_desarrolladores VALUES(@juegos_last_id, @desarrolladores_last_id);
	ELSE
		SELECT id INTO @desarrollador_id FROM desarrolladores WHERE nombre = developer_var;
        INSERT INTO juegos_desarrolladores VALUES(@juegos_last_id, @desarrollador_id);
    END IF;

    -- Publisher
    SELECT COUNT(*) INTO @publisher_validation FROM publicadores WHERE nombre = publisher_var;
    IF @publisher_validation = 0 THEN
        INSERT INTO publicadores(nombre) VALUES(publisher_var);
        SELECT MAX(id) INTO @publicadores_last_id FROM publicadores;
        INSERT INTO juegos_publicadores VALUES(@juegos_last_id, @publicadores_last_id);
	ELSE
		SELECT id INTO @publicador_id FROM publicadores WHERE nombre = publisher_var;
        INSERT INTO juegos_publicadores VALUES(@juegos_last_id, @publicador_id);
    END IF;
    
    -- clasificaiones
    IF esrb_var IS NOT NULL AND esrb_var != '' THEN
        SELECT COUNT(*) INTO @esrb_validation FROM clasificaciones WHERE nombre = esrb_var;
        IF @esrb_validation = 0 THEN
            INSERT INTO clasificaciones(nombre) VALUES (esrb_var);
            SELECT MAX(id) INTO @esrb_last_id FROM clasificaciones;
            INSERT INTO juegos_clasificaciones(juego_id, clasificacion_id) VALUES(@juegos_last_id, @esrb_last_id);
        ELSE
            SELECT id INTO @esrb_id FROM clasificaciones WHERE nombre = esrb_var;
            INSERT INTO juegos_clasificaciones VALUES(@juegos_last_id, @esrb_id);
        END IF;
    END IF;
    
    -- generos
    select count(*) into @genre_validation from generos where nombre = genre_var;
    if @genre_validation = 0 then
		insert into generos(nombre) values (genre_var);
        select max(id) into @genre_last_id from generos;
        insert into juegos_generos(juego_id, genero_id) values(@juegos_last_id, @genre_last_id);
	else
		select id into @genre_id from generos where nombre = genre_var;
        INSERT INTO juegos_generos VALUES(@juegos_last_id, @genre_id);
	end if;


    insert into ratings(id, metarating, userrating) values(@juegos_last_id, metarating_var, userrating_var);

END//
create procedure fill_consoles_from_tuple(in gamename_var varchar(255), platform_var varchar(255))
begin
	select count(*) into @consola_validation from consolas where nombre = platform_var;
    if @consola_validation = 0 then
		insert into consolas(nombre) values(platform_var);
	end if;
	select id into @game_id from juegos where nombre = gamename_var;
    select id into @consola_id from consolas where nombre = platform_var;
    insert into juegos_consolas(juego_id, consola_id) values(@game_id, @consola_id);
end//
DELIMITER ;


